package main

func CycpatternCheck(a, b string) bool {
    if len(b) == 0 {
        return true
    }

    if len(a) < len(b) {
        return false
    }

    // Create a string that is the concatenation of b with itself
    doubleB := b + b

    // Check if any rotation of b (which are substrings of doubleB) is in a
    for i := 0; i < len(b); i++ {
        if aContainsRotation(a, doubleB[i:i+len(b)]) {
            return true
        }
    }

    return false
}

// Helper function to check if a contains the substring
func aContainsRotation(a, sub string) bool {
    for i := 0; i <= len(a)-len(sub); i++ {
        if a[i:i+len(sub)] == sub {
            return true
        }
    }
    return false
}
